import React from 'react';
import './App.css';
import logo from './assets/logo.png';
import leaf from './assets/leaf.png';

function App() {
  return (
    <div className="app">
      {/* Header */}
      <header className="header">
        <img src={logo} alt="Logo" className="logo" />
        <button className="demo-button">Request Demo</button>
      </header>

      {/* First Section */}
      <section className="hero-section">
        <div className="content">
          <h1>
            Creativity
            <br />
            <span>Beyond Limits</span>
          </h1>

        </div>
        <img src={leaf} alt="Background Leaf" className="background-leaf" />
      </section>

      {/* Second Section */}
      <section className="info-section">
        <p className="info-text">
          Pigeon Post is built for boundless. For creators who want to break through barriers
        </p>
      </section>
    </div>
  );
}

export default App;
